def find_solution(a, b, n):
    # Check if a and b are both zero
    if a == 0 and b == 0:
        return None

    # Check if a and b are both non-zero and n is divisible by their greatest common divisor
    if a != 0 and b != 0 and n % math.gcd(a, b) == 0:
        # Use the extended Euclidean algorithm to find x and y
        x, y, gcd = extended_euclidean(a, b)
        # Multiply x and y by n/gcd to get a solution for ax + by = n
        return (x * (n // gcd), y * (n // gcd))

    # Check if a is zero and n is divisible by b
    if a == 0 and n % b == 0:
        return (0, n // b)

    # Check if b is zero and n is divisible by a
    if b == 0 and n % a == 0:
        return (n // a, 0)

    # No solution exists
    return None

def extended_euclidean(a, b):
    if b == 0:
        return (1, 0, a)
    else:
        x, y, gcd = extended_euclidean(b, a % b)
        return (y, x - (a // b) * y, gcd)
```

