Next, we check if both `a` and `b` are non-zero and if `n` is divisible by their greatest common divisor (GCD). If these conditions are met, we use the extended Euclidean algorithm to find `x` and `y` such that `ax + by = gcd(a, b)`. We then multiply `x` and `y` by `n/gcd` to get a solution for `ax + by = n`.

If `a` is zero and `n` is divisible by `b`, we return `(0, n // b)` as a solution.

If `b` is zero and `n` is divisible by `a`, we return `(n // a, 0)` as a solution.

