def max_sum_increasing_subsequence(nums, k):
    n = len(nums)
    dp = [0] * n

    for i in range(n):
        dp[i] = nums[i]
        for j in range(i):
            if nums[i] > nums[j]:
                dp[i] = max(dp[i], dp[j] + nums[i])

    max_sum = max(dp)
    if k > n:
        return max_sum

    return max(max_sum, max_sum + nums[k])

